import React, { Component } from 'react';
import Link from "next/link";

class Home extends Component {
  render() {
    return (
      <>
        <nav>
          <Link href="/">
            <a>Home</a>
          </Link>{" "}
          -
        <Link href="/about">
            <a>About</a>
          </Link>{" "}
          -
        <Link href="/users">
            <a>Users</a>
          </Link>{" "}
          -
        <Link href="/contact">
            <a>Contact</a>
          </Link>
        </nav>
        <h1>Welcome to NextJS</h1>
      </>
    );
  }
}

export default Home;
